import React from "react"; 
import {ListGroup} from "react-bootstrap";

const Li = (props) => {

    return (
        <ListGroup variant="flush">
        <ListGroup.Item>Education 1</ListGroup.Item>
        <ListGroup.Item>Education 2</ListGroup.Item>
        <ListGroup.Item>Education 3</ListGroup.Item>
        <ListGroup.Item>Education 4</ListGroup.Item>
      </ListGroup>  
    )
};

export default Li;
